"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:8.25pt;\">  -master_m3u8_publish_rate &lt;int&gt;        E.......... Publish master playlist every after this many segment intervals (from 0 to UINT32_MAX) (default 0)</span></p>\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:8.25pt;\">  -write_prft        &lt;boolean&gt;    E.......... Write producer reference time element (default auto)</span></p>\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:8.25pt;\">  -mpd_profile       &lt;flags&gt;      E.......... Set profiles. Elements and values used in the manifest may be constrained by them (default dash)</span></p>\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:8.25pt;\">     dash                         E.......... MPEG-DASH ISO Base media file format live profile</span></p>\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:8.25pt;\">     dvb_dash                     E.......... DVB-DASH profile</span></p>\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:8.25pt;\">  -http_opts         &lt;dictionary&gt; E.......... HTTP protocol options</span></p>\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:8.25pt;\">  -target_latency    &lt;duration&gt;   E.......... Set desired target latency for Low-latency dash (default 0)</span></p>\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:8.25pt;\">  -min_playback_rate &lt;rational&gt;   E.......... Set desired minimum playback rate (from 0.5 to 1.5) (default 1/1)</span></p>\n"
